import { useState } from 'react';
import './App.css';

function App() {

  const [data, setData] = useState(null);

  const getData = (event) => {
    setData(event.target.value);
    console.log(event.target.value);
  }
  return (
    <div className="App">
      <h1>{data}</h1>
      <input type="text" onChange={getData}></input>
    </div>
  );
}

export default App;
